$pdf = new TCPDF();
// 设置打印模式,设置文档信息
$pdf->SetCreator(PDF_CREATOR);
$pdf->SetAuthor('Nicola Asuni');
$pdf->SetTitle('开标说明');
$pdf->SetSubject('TCPDF Tutorial');
$pdf->SetKeywords('TCPDF, PDF, PHP, example, test, guide');
// 是否显示页眉和是否显示页脚
$pdf->setPrintHeader(false);
$pdf->setPrintFooter(true);
// 设置页眉和页脚信息内容
$pdf->SetHeaderData('logo.jpg', 40, 'Helloweba.com', '代付凭证信息', array(0,64,255), array(0,64,128));
$pdf->setFooterData(array(0,64,0), array(0,64,128));
// 设置页眉和页脚字体
$pdf->setHeaderFont(Array('dejavusans', '', '12'));
$pdf->setFooterFont(Array('dejavusans', '', '10'));
 // 设置间距
$pdf->SetHeaderMargin('5');
$pdf->SetFooterMargin('10');
// 设置左、上、右的间距
$pdf->SetMargins('10', '10', '10');
// 设置是否自动分页  距离底部多少距离时分页
$pdf->SetAutoPageBreak(TRUE, '15');
// 设置默认等宽字体
$pdf->SetDefaultMonospacedFont('courier');
// 设置行高
$pdf->setCellHeightRatio(1);
// 设置图像比例因子
$pdf->setImageScale(1.25);
//设置默认字体子集模式
$pdf->setFontSubsetting(true);
// 设置字体
$pdf->SetFont('stsongstdlight', '', 14, '', true);
$pdf->AddPage();
$pdf->writeHTMLCell(0, 0, '', '', $html, 0, 1, 0, true, '', true);
//PDF输出   I：在浏览器中打开，D：下载，F：在服务器生成pdf ，S：只返回pdf的字符串
ob_clean();
#定义上传目录
$dir= $_SERVER['DOCUMENT_ROOT'].'uploads';
$pdf->Output($dir.'/output12.pdf', 'F');
echo "over";
